import React from 'react'

function SearchBox({ filterValue, setFilter }) {
  return (
    <input
      value={filterValue || ""}
      onChange={(e) => {
        setFilter(e.target.value || undefined);
      }}
      placeholder={`Search records...`}
    />
  );
}
